INSERT INTO blueberry_wageposting
   (siteid_id, employerid_id, uid_id, position, wage, year) 
SELECT 
    site.siteid, employer.employerid, wages.uid, wages.position, wages.wage, wages.year
FROM 
  wages
  	JOIN blueberry_site as site on site.zip_code = wages.zip_code
  	JOIN blueberry_employer as employer on employer.employer_name = wages.employer_name;



